  const favoritesCtx = useContext(FavoritesContext);

  let content;
  let phrase 

  if (favoritesCtx.totalFavorites === 0) {
    content = <img src='https://firebasestorage.googleapis.com/v0/b/react-training-ca974.appspot.com/o/source%2Fpacany.webp?alt=media&token=2a474138-cdf4-4a4f-b522-c56cdcb047ce'/>
    phrase = "Начальник, где пополнение?"
  } else {
    content = <MeetupList meetups={favoritesCtx.favorites} />;
    phrase= "Образоавнные интелегенты"
  }

  return (
    <section>
      <h1>{phrase}</h1>
      {content}
    </section>
  );
}

export default FavoritesPage;
